    jenis_objek: "Warga",
    informasi_masuk: "06/01/2024",
    jam_masuk: "08:00",
    informasi_keluar: "06/01/2024",
    jam_keluar: "08:00",
    keterangan: "Ingin berkunjung ke rumah bapak",
